import React, { Component } from 'react'
import { Card,Layout } from 'antd'
import UserHead from '../../../components/UserHead'
export default class TicketList extends Component {
    render() {
        return (
            <div>
                <Layout>
                    <Header><UserHead /></Header>
                    <Content>Content</Content>
                </Layout>
            </div>
        )
    }
}
